Description:
the results of risk management planning are documented in the risk management plan: the plan serves
to provide all project stakeholders with a common view of how the risk-related activities of the project will be
handled; what has been agreed upon; and a description of the stakeholders' involvement and responsibilities
in these activities. an overview of the
areas of focus is given in figure 4-1.
figure 4-1. key areas of focus for the plan risk management process
depending upon the size and complexity of the project; some or all of the following elements will be present
in a risk management plan:
introduction;
project description;
risk management methodology;
risk management organization;
roles, responsibilities, and authority;
stakeholder risk tolerance;
criteria for success;
risk management tools and guidelines for use;
thresholds and corresponding definitions;
templates;
communications plan;
strategy; and
risk breakdown structure.
